async function getIcon(name) {
  return {path: PG_ICONS_MAP[name]?.path};
}
async function getIconList() {
  return Object.entries(PG_ICONS_MAP).map(([icon, content]) => ({
    name: icon,
    keywords: content.keywords,
  }));
}

